import { Style } from '@material-ui/icons';
import React,{useEffect, useState }from 'react';
import axios from 'axios';


const ComA=()=>{
const [num,setnum] =useState(1);
const [name,setname] =useState(0);
const [value , setvalue] =useState();

useEffect(()=>{
    async function getData(){
        const res = await axios.get(`https://pokeapi.co/api/v2/pokemon/${num}`)
        setname(res.data.name)
        setvalue(res.data.value.length)
    }

getData();

})
return (<>
<h1 className='text-capitalize m-5 center col-2'> You selected {num}</h1>
<h1 className='text-capitalize m-5 center col-2'> my name is {name}</h1>
<h1 className='text-capitalize m-5 center col-2'> i moves {value}  steps</h1>
<select value={num }  onChange={(event)=>{setnum(event.target.value)}}>
<option value='1'>1</option>
<option value='25'>25</option>
<option value='3'>3</option>
<option value='4'>4</option>
<option value='5'>5</option>


</select>



</>);

}

export default ComA;
